import React from 'react';
import '.';

const EventPanel = ({ isOpen, onClose }) => {
    return (
        <div className="event-panel" style={{ display: isOpen ? 'block' : 'none' }}>
            <h2>Panel de Eventos</h2>
            <button className="event-panel__close-btn" onClick={onClose}>Cerrar Panel</button>
        </div>
    );
}

export default EventPanel;
